import TaskInfo from './components/organism/cardinfo/TaskInfo';



export default function App(){



  return(

    <div className="App">
    <Provider store={store}>
 <Routes>
  <Route path='/' element={<Board/>}/>
  {/*<Route path='/:Cid/:Lid/edit' element={<TaskInfo/>} />*/}
 </Routes>
    </Provider>

    </div>
  )
}
